@MinPres #Staatsbosbeheer #OVP maakt zich structureel schuldig aan dierenleed, geeft onjuiste voorlichting, liegt tegen een Lid van de Tweede Kamer der Staten-Generaal en weigert toegang! 

#Shameonyou @staatsbosbeheer 

https://t.co/yT3JWArX4u… via @TeamYouTube

@MinPres Zoals geen belastingen op bonussen van snelle beursjongen?
Je zou je kapot moeten schamen.
https://t.co/bfpWvInPqg

@MinPres Zo zeggen dat je prioriteiten moet stellen, en dat is niet Commercieel of Economisch.
Prioriteit moet zijn het WELZIJN en Kwaliteit van Leven voor Eigen BURGER, en zeker de Ouderen.
Dan krijg je diens vertrouwen weer terug. En dan pas volgt de Economie en daarna het Commerciële.

